export default (function(a,b,c,d){return {data:{"12D1FpVHhp":{data:{id:263,attributes:{imdbId:"tt0078843",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BYzcxNWEzNzctOWIwMi00OWM0LWIzNDEtYTY4MGMyYWUwMDhjXkEyXkFqcGdeQXVyNzc5MjA3OA@@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"5.5\u002F10"},{Source:"Rotten Tomatoes",Value:"0%"}],item_lang:{data:{id:926,attributes:{title:b,plot:"Details a young woman's summer in New York working for a Mademoiselle-like magazine, return home to New England, and subsequent breakdown all amidst the horrors of the fifties, from news of the Rosenbergs' execution to sleazy disc jockeys and predatory college boys.",slug:"the-bell-jar"}}},books:{data:[{id:2835,attributes:{title:b,description:"A realistic and emotional look at a woman who falls into the grips of insanity written by the iconic American writer Sylvia Plath “It is this perfectly wrought prose and the freshness of Plath’s voice in The Bell Jar that make this book enduring in its appeal.” — USA Today The Bell Jar chronicles the crack-up of Esther Greenwood: brilliant, beautiful, enormously talented, and successful, but slowly going under—maybe for the last time. Sylvia Plath masterfully draws the reader into Esther’s breakdown with such intensity that Esther’s insanity becomes completely real and even rational, as probable and accessible an experience as going to the movies. Such deep penetration into the dark and harrowing corners of the psyche is an extraordinary accomplishment and has made The Bell Jar a haunting American classic. This P.S. edition features an extra 16 pages of insights into the book, including author interviews, recommended reading, and more.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=G-f1CQAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:true,published:"2015-08-11",publisher:"HarperCollins",subtitle:"A Novel"}},{id:2836,attributes:{title:b,description:"I was supposed to be having the time of my life.When Esther Greenwood wins an internship on a New York fashion magazine in 1953, she is elated, believing she will finally realise her dream to become a writer. But in between the cocktail parties and piles of manuscripts, Esther's life begins to slide out of control. She finds herself spiralling into depression and eventually a suicide attempt, as she grapples with difficult relationships and a society which refuses to take women's aspirations seriously.The Bell Jar, Sylvia Plath's only novel, was originally published in 1963 under the pseudonym Victoria Lucas. The novel is partially based on Plath's own life and descent into mental illness, and has become a modern classic. The Bell Jar has been celebrated for its darkly funny and razor sharp portrait of 1950s society and has sold millions of copies worldwide.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=QuYRogEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:d,published:"2013-01-01",publisher:c,subtitle:c}},{id:2837,attributes:{title:b,description:c,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=LMCwAAAAIAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:d,published:"1979-01-01",publisher:c,subtitle:c}},{id:2838,attributes:{title:b,description:"Get your \"A\" in gear! They're today's most popular study guides-with everything you need to succeed in school. Written by Harvard students for students, since its inception SparkNotes™ has developed a loyal community of dedicated users and become a major education brand. Consumer demand has been so strong that the guides have expanded to over 150 titles. SparkNotes'™ motto is Smarter, Better, Faster because: · They feature the most current ideas and themes, written by experts. · They're easier to understand, because the same people who use them have also written them. · The clear writing style and edited content enables students to read through the material quickly, saving valuable time. And with everything covered--context; plot overview; character lists; themes, motifs, and symbols; summary and analysis, key facts; study questions and essay topics; and reviews and resources--you don't have to go anywhere else!",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=IqJorHnQ60EC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:d,published:"2002-01-01",publisher:"Spark Publishing Group",subtitle:a}},{id:2839,attributes:{title:"The Bell Jar by Sylvia Plath",description:"Sylvia Plath's shocking, realistic, and intensely emotional novel about a woman falling into the grip of insanity. Esther Greenwood is brilliant, beautiful, enormously talented, and successful, but slowly going under--maybe for the last time. In her acclaimed and enduring masterwork, Sylvia Plath brilliantly draws the reader into Esther's breakdown with such intensity that her insanity becomes palpably real, even rational--as accessible an experience as going to the movies. A deep penetration into the darkest and most harrowing corners of the human psyche, The Bell Jar is an extraordinary accomplishment and a haunting American classic.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=dDtTvwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a,"Christmas EDITION"],firstBook:d,published:"2018-12-01",publisher:"Independently Published",subtitle:"Sylvia Plath Christmas Edition"}}]}}},meta:{}}},prerenderedAt:1680940920519}}("Sylvia Plath","The Bell Jar","",null))